const App = () => {
  const isUserLoggedIN = true;
  const [counter,setCounter] = useState(0);
  useEffect(() => {
    setCounter(100);
  },[]);
  
  return (
    <div className="App">
      <Person 
      name = {'Jozo'} 
      lastName={'Kybel'} 
      age = {'22'}/>
      <Person 
      name = {'Jozina'} 
      age={4+4}/>

      <button onClick={()=>setCounter((prevCount)=>prevCount-1)}>-</button>
      <h1>{counter}</h1>
      <button onClick={()=>setCounter((prevCount)=>prevCount+1)}>+</button>
    </div>
  );
}

const Person = (props) => {
  const isUserLoggedIN = true;

  return (
    <>
      <h1>Name : {props.name}</h1>
      <h2>Last Name : {props.lastName}</h2>
      <h2>Age : {props.age}</h2>
    </>
  );
}


export default App;
